import React from 'react';

 const uri = 'http://localhost:3001'; 



class Rank extends React.Component {
  constructor() {
    super();
    this.state = {
      users: []
    }
    }

    componentDidMount() {
      console.log('finished loading');
      fetch(uri + '/score', {
        method: 'get',
        headers: {'Content-Type': 'application/json'},
            })
            .then(response => response.json())
            .then(users => this.setState({users}))
      .catch(err => console.log(err));
    }

render() {
  const { users } = this.state;
	return(
		 <div>
		 	<div className='white f3 flex pa2 pl7'>
		 	<ol>
 			 <li> {users[0].name}: {users[0].entries} entries</li>
 			 <li> {users[1].name}: {users[1].entries} entries</li>
 			 <li> {users[2].name}: {users[2].entries} entries</li>
 			 <li> {users[3].name}: {users[3].entries} entries</li>
 			 <li> {users[4].name}: {users[4].entries} entries</li>
			</ol>
     		</div>
		 </div>
		);
}
}



export default Rank;
